import styled from "styled-components";

const Wrapper = styled.div`
  width: 330px;
  height: 180px;
  border: 1px solid black;
  border-radius: 20px;
  z-index: 1000;

  display: inline-block;
  vertical-align: middle;

`;

const Modal = () => {
  return <Wrapper></Wrapper>;
};

export default Modal;
